import React from "react";
import human from "../../../Image/human.jpg";
import "./One.css";

class One extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <nav class="navbar navbar-light bg-light">
        <a class="navbar-brand" href="##">
          <img src={human} width="50" height="50" alt="" />
        </a>
      </nav>
    );
  }
}

export default One;
